  true,\n\t\"url\": null,\n\t\"notes\": \"Quick Stats API is the programmatic interface
  to the National Agricultural Statistics Service's (NASS) online database containing
  results from the 1997, 2002, 2007, and 2012 Censuses of Agriculture as well as the
